// function to count the number of unique email addresses
function f_gold(emails) {
    // create a new Set to store unique email addresses
    var s = new Set();
    // loop through each email in the input array
    for (var email of emails) {
        // split the email into local and domain parts
        var local = email.split('@');
        var domain = local[1];
        // remove all periods from the local part
        local = local[0].replaceAll('.', '');
        // find the index of the '+' character in the local part
        var i = local.indexOf('+');
        // if '+' exists, remove all characters after it
        if (i != -1) {
            local = local.substring(0, i);
        }
        // add the modified email address to the Set
        s.add(local + '@' + domain);
    }
    // return the size of the Set, which is the number of unique email addresses
    return s.size;
}
```
